import './styles.css';
import { useState, useEffect } from 'react';

import generateCode from './GenerateCode.js';
import codeTest from './CodeTest.js';
import OutcomeModal from './GameResultsModal';
import RoundOutput from './RoundOutput.js';
import DragAndDropHandler from './DragDropHandler';

import circleWhite from './assets/circle-white.png';
import circleBlack from './assets/circle-black.png';
import circleBlue from './assets/circle-blue.png';
import circleRed from './assets/circle-red.png';
import circleYellow from './assets/circle-yellow.png';
import circleOrange from './assets/circle-orange.png';
import circleGreen from './assets/circle-green.png';
import circleViolet from './assets/circle-violet.png';

import circleGrey from './assets/circle-grey.png';




function App() {

  const[testResult, setTestResult] = useState(Array(12).fill(["GRY", "GRY", "GRY", "GRY", "GRY", "GRY", "GRY", "GRY"]))

  const [dragInputCircleOne, setDragInputCircleOne] = useState({ color: circleGrey, value: '' })
  const [dragInputCircleTwo, setDragInputCircleTwo] = useState({ color: circleGrey, value: '' })
  const [dragInputCircleThree, setDragInputCircleThree] = useState({ color: circleGrey, value: ''})
  const [dragInputCircleFour, setDragInputCircleFour] = useState({ color: circleGrey, value: ''})

  const [turnCount, setTurnCount] = useState(0);
  const [gameStatus, setGameStatus] = useState('');
  const [secretCode, setSecretCode] =useState([]);

  const { onDragStart, onDragOver, onDrop } = DragAndDropHandler({
    setDragInputCircleOne,
    setDragInputCircleTwo,
    setDragInputCircleThree,
    setDragInputCircleFour
  });


  //creates the code to break
  useEffect(() =>{    
    setSecretCode(generateCode());;

  },[]);

  console.log(secretCode)



  //runs the test logic
  const runCodeTest = () => {
                    //codeTest is the logic module that determines if the user got it right
    const result = codeTest([dragInputCircleOne['value'], dragInputCircleTwo['value'], dragInputCircleThree['value'], dragInputCircleFour['value']], secretCode)

    const updateArray = (index, newArray) => {
      setTestResult(prevState => {
        const newState = [...prevState];
        newState[index] = newArray;
        return newState;
      });
    };

    if (result.slice(4).every(el => el === 'H') === true) {
      // win show modal
      setGameStatus('Win')
    }
    updateArray(turnCount, result)

    //console.log(turnCount)
    setTurnCount(Num => Num + 1)

    if (turnCount > 12) return setGameStatus('Lose')
  }

  const colorMap = {
    'WHT': circleWhite,
    'BLK': circleBlack,
    'BLU': circleBlue,
    'RED': circleRed,
    'YLW': circleYellow,
    'ORG': circleOrange,
    'GRN': circleGreen,
    'VLT': circleViolet,
    'GRY': circleGrey,
    'H': circleBlack,
    'M': circleWhite,
    'F': circleGrey
  };




  return (
    <div className="App">
      <div className="header">
        <p className="mastermind-logo">MASTERMIND</p>
      </div>

      {/*game outcome Modal*/}
      <OutcomeModal
        gameStatus={gameStatus}
        turns={turnCount}
        setTurnCount={setTurnCount}
        setGameStatus={setGameStatus}
        setTestResult={setTestResult}
        setDragInputCircleOne={setDragInputCircleOne}
        setDragInputCircleTwo={setDragInputCircleTwo}
        setDragInputCircleThree={setDragInputCircleThree}
        setDragInputCircleFour={setDragInputCircleFour}
        setSecretCode={setSecretCode}
      />

      <div className="backdrop">
        {/*output circles that will give clues to the player */}
        <span className='top'></span>
        <RoundOutput data={testResult[11]} colorMap={colorMap} />
        <RoundOutput data={testResult[10]} colorMap={colorMap} />
        <RoundOutput data={testResult[9]} colorMap={colorMap} />
        <RoundOutput data={testResult[8]} colorMap={colorMap} />
        <RoundOutput data={testResult[7]} colorMap={colorMap} />
        <RoundOutput data={testResult[6]} colorMap={colorMap} />
        <RoundOutput data={testResult[5]} colorMap={colorMap} />
        <RoundOutput data={testResult[4]} colorMap={colorMap} />
        <RoundOutput data={testResult[3]} colorMap={colorMap} />
        <RoundOutput data={testResult[2]} colorMap={colorMap} />
        <RoundOutput data={testResult[1]} colorMap={colorMap} />
        <RoundOutput data={testResult[0]} colorMap={colorMap} />
        <span className='bot'></span>

        <div className="game-controls">
          <div className='controls1'>
                                            {/*target circles that will hold the choices of user*/}
            <span className='circle-input'><img alt="Control circle Input" draggable="false" src={dragInputCircleOne['color']} onDragOver={onDragOver} onDrop={(e) => onDrop(e, 'target1')} className='circle-controls-2'/></span>
            <span className='circle-input'><img alt="Control circle Input" draggable="false" src={dragInputCircleTwo['color']} onDragOver={onDragOver} onDrop={(e) => onDrop(e, 'target2')} className='circle-controls-2'/></span>
            <span className='circle-input'><img alt="Control circle Input" draggable="false" src={dragInputCircleThree['color']} onDragOver={onDragOver} onDrop={(e) => onDrop(e, 'target3')} className='circle-controls-2'/></span>
            <span className='circle-input'><img alt="Control circle Input" draggable="false" src={dragInputCircleFour['color']} onDragOver={onDragOver} onDrop={(e) => onDrop(e, 'target4')} className='circle-controls-2'/></span>

                                            {/*checks to see if all inputs are filled*/}
            <button className='buttoncheck' disabled={[dragInputCircleOne['value'], dragInputCircleTwo['value'], dragInputCircleThree['value'], dragInputCircleFour['value'] ].some(circle => circle === '')} onClick={runCodeTest}> CHECK </button>
          </div>


          <div className='controls2'>
                                            {/*circles choices */}
            <span className='circle-input'><img  alt="Control choices circle Blue"    draggable="true" src={circleBlue}    onDragStart={(e) => onDragStart(e, circleBlue, 'BLU')}     className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Red"     draggable="true" src={circleRed}     onDragStart={(e) => onDragStart(e, circleRed, 'RED')}      className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Yellow"  draggable="true" src={circleYellow}  onDragStart={(e) => onDragStart(e, circleYellow, 'YLW')}   className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Orange"  draggable="true" src={circleOrange}  onDragStart={(e) => onDragStart(e, circleOrange, 'ORG')}   className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Green"   draggable="true" src={circleGreen}   onDragStart={(e) => onDragStart(e, circleGreen, 'GRN')}    className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Violet"  draggable="true" src={circleViolet}  onDragStart={(e) => onDragStart(e, circleViolet, 'VLT')}   className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle White"   draggable="true" src={circleWhite}   onDragStart={(e) => onDragStart(e, circleWhite,'WHT')}     className='circle-controls-1 cursor-grab'/></span>
            <span className='circle-input'><img  alt="Control choices circle Black"   draggable="true" src={circleBlack}   onDragStart={(e) => onDragStart(e, circleBlack, 'BLK')}    className='circle-controls-1 cursor-grab'/></span>         
          </div>

        </div>
      </div>
    </div>
  );
}




export default App;
